import React, { useEffect, useState } from "react";
import { Link } from 'react-router-dom';
import { useMovies } from "../hooks/useMovies";


export const MoviesList = () => {
 const movies = useMovies();

  return (
    <>
      <h1>Popular Films</h1>
      <ul>
          <li>
          <Link to={`/movie/${movies.id}`}>
            {movies.title}
          </Link>
          </li>
        )
      </ul>
    </>
  );
};
